import React, { useEffect } from 'react';
import Header from './Header';
import Footer from './Footer';
import WhatsAppButton from './WhatsAppButton/WhatsAppButton';
import Map from './Map';
import './HeroSection.css';

const HeroSection = () => {
  useEffect(() => {
    // jQuery and Owl Carousel initialization
    if (window.$('.testimonial-carousel').length) {
      window.$('.testimonial-carousel').owlCarousel({
        animateOut: 'slideOutDown',
        animateIn: 'zoomIn',
        loop: true,
        margin: 0,
        nav: true,
        smartSpeed: 300,
        autoplay: 7000,
        navText: ['<span class="arrow-left"></span>', '<span class="arrow-right"></span>'],
        responsive: {
          0: {
            items: 1
          },
          600: {
            items: 1
          },
          800: {
            items: 1
          },
          1024: {
            items: 1
          }
        }
      });
    }
  }, []);

  return (
    <div>
      {/* Testimonial Section */}
      <section className="testimonial-section">
        <div className="large-container">
          <div className="sec-title">
            <span className="title">Testimonial</span>
            <h2>What Our core client say?</h2>
          </div>

          <div className="testimonial-carousel owl-carousel owl-theme">
            {/* Testimonial Block */}
            <div className="testimonial-block">
              <div className="inner-box">
                <div className="text">
                  Why is this important? Because clients want to know the businesses they depend on for advice, are well managed in their own right. Not only that but this event gives you the chance to give your back-office team.
                </div>
                <div className="info-box">
                  <div className="thumb"><img src="http://t.commonsupport.com/adro/images/resource/thumb-1.jpg" alt="testimonial" /></div>
                  <h4 className="name">Mahfuz Riad</h4>
                  <span className="designation">UI Designer & CEO</span>
                </div>
              </div>
            </div>

            {/* Testimonial Block */}
            <div className="testimonial-block">
              <div className="inner-box">
                <div className="text">
                  Why is this important? Because clients want to know the businesses they depend on for advice, are well managed in their own right. Not only that but this event gives you the chance to give your back-office team.
                </div>
                <div className="info-box">
                  <div className="thumb"><img src="http://t.commonsupport.com/adro/images/resource/thumb-1.jpg" alt="testimonial" /></div>
                  <h4 className="name">Mahfuz Riad</h4>
                  <span className="designation">UI Designer & CEO</span>
                </div>
              </div>
            </div>

            {/* Testimonial Block */}
            <div className="testimonial-block">
              <div className="inner-box">
                <div className="text">
                  Why is this important? Because clients want to know the businesses they depend on for advice, are well managed in their own right. Not only that but this event gives you the chance to give your back-office team.
                </div>
                <div className="info-box">
                  <div className="thumb"><img src="http://t.commonsupport.com/adro/images/resource/thumb-1.jpg" alt="testimonial" /></div>
                  <h4 className="name">Mahfuz Riad</h4>
                  <span className="designation">UI Designer & CEO</span>
                </div>
              </div>
            </div>
          </div>

          <div className="thumb-layer paroller">
            <figure className="image"><img src="http://t.commonsupport.com/adro/images/resource/user-thumbs.png" alt="user thumbs" /></figure>
          </div>
        </div>
      </section>
      {/* End Testimonial Section */}
    </div>
  );
};

export default HeroSection;
